import {useState} from 'react';
import goodimage from './images/happyguy.jpeg';
import badimage from './images/sadembiid.jpeg';
function FeelingToday({name}){
    const [good, setGood] = useState();
    const handleBad= ()=>{
        setGood(false);
    }
    const handleGood= ()=>{
        setGood(true);
    }
    let content = good? <img src={goodimage} alt="Giannis wins"></img>: <div></div>
    return(
        <div>
            Hello, {name}, how are you doing today?
            <button onClick={handleGood}>Good</button>
            <button onClick={handleBad}>Bad</button>
            {content}
        </div>
    )
}
export default FeelingToday;
